import React, { Component } from 'react'
import { connect } from 'react-redux'

class DemoRedux extends Component {
  render() {
    const {demoRedux}=this.props
    return (
    // console.log(this.props)
      
      <div className='container'>
       <p className="display-3">Number: {demoRedux}</p>
       <button className='btn btn-success mr-5'>+</button>
      </div>
    )
  }
}
const mapStateToProps=(rootReducers)=>{
    return{
        DemoRedux: rootReducers.demoRedux,
    }
}
export default connect(mapStateToProps)(DemoRedux)
